import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import ContactUs from "./components/contact.jsx";
const Home = () => {
return(
    <Router>
        <Routes>
            <Route path="/" element={<h1>Home page</h1>} />            <Route path="/contact" element={<ContactUs />} />
        </Routes>
    </Router>
);
};
export default Home;
